import Club from '../models/Club';
import Course from '../models/Course';
import Testimony from '../models/Testimony';

export const clubs: Club[] = [
  new Club('Chess Club', 'Sharpen your strategy skills'),
  new Club('Mathletes', 'Competitive mathematics team')
];

export function addClub(name: string, description: string) {
  clubs.push(new Club(name, description));
}

export const courses: Course[] = [
  new Course('Intro to Programming', 'Learn the basics of programming'),
  new Course('Data Structures', 'In-depth data handling')
];

export function addCourse(title: string, description: string) {
  courses.push(new Course(title, description));
}

export const testimonies: Testimony[] = [
  new Testimony('John Doe', 'This is fantastic!'),
  new Testimony('Jane Smith', 'Loved every moment')
];

export function addTestimony(author: string, content: string) {
  testimonies.push(new Testimony(author, content));
}
